VALUES ('4036117020248', 'Pelmeni', 'Pâte 60% (FARINE DE BLÉ, eau, huile de colza, sel de cuisine), Farce à base de viande 40% (oorc 52%, viande de bœuf eau, oignon, sel de cuisine épices). Peut contenir des traces de: OEUF, ARACHIDES SOJA, LAIT, CELERI MOUTARDÉ. Préparation des ravioles: élongez les ravioles surgelés dans 3 litres d\'eau portée à ébullitions Laissez bouillir brièvement jusqu\'à ce que les ravioles remontent à la surface. Laisser cuire 6 à 7 minutes env. à feu moyen. Sortir les ravioles de l\'eau au moyen d\'une écumoire, dresser en agrémentant de quelques morceaux de beurre et servir chaud. Astuce pour raffiner votre plat: Après la cuisson, garnir les ravioles de crème fraîche selon votre goût Utilisez le produit immediatement une fois décongelé et ne le recongelezpas. Date limite de conservation à -180C: voir cachet au dos de l\'emballage. Poids net â l\'emballage: 1500g', 'https://static.openfoodfacts.org/images/products/403/611/702/0248/front_fr.4.400.jpg', '8', '2.6', '29.9', '0.5', '', '9', '1.3', '0.511811023622047', '', '0');

